import React from 'react';
import "./Login.css";
function login() {
  return (
    <div className='login'>
      <img src="linkedin3.png" alt="" />
     <form>
        <input type="text" placeholder="Full name (required)" />
        <input type="password" placeholder="password" />
        <input type="Email" placeholder='Email' />
        <input type="password" placeholder='Password' />
        <button>Login</button>
     </form>

     <p></p>
    </div>
  );
}

export default login;
